import React from "react";
import NavBar from "../UI/Header/Navbar/Navbar";
const Layout = ({ children }) => {
  return (
    <React.Fragment>
      <NavBar />
      <p>Jumbotron</p>
      {children}
      <p>Footer</p>
    </React.Fragment>
  );
};

export default Layout;
